import React, { useState } from "react";
import {
  NavE,
  NavIcon,
  NavIcons,
  NavItem,
  NavLogo,
  NavMenu,
} from "./Nav.element";

const Nav = () => {
  const [isMobile, setIsMobile] = useState(false);
  return (
    <NavE>
      <NavLogo src="images/logo.svg"></NavLogo>
      <NavIcons>
        <NavIcon
          isMobile={isMobile}
          onClick={() => setIsMobile((p) => !p)}></NavIcon>
      </NavIcons>
      <NavMenu>
        <NavItem>About</NavItem>
        <NavItem>Download</NavItem>
        <NavItem>Pricing</NavItem>
      </NavMenu>
    </NavE>
  );
};

export default Nav;
